import React, { useState } from 'react'
import buttonCss from "./Css/button.css"

export default function TableData() {

    const [todo, setTodo] = useState([
        {
            name: "Ankit",
            todo: "Hi ankit last task"
        },
        {
            name: "Ankur",
            todo: "Hi Ankur last task"
        },
    ])

    // useEffect(() => {
    //     return () => {
    //         cleanup
    //     }
    // }, [input])

    const deleteTodo = (e) => {
        let newState = todo.filter((item, index) => index != e.target.name)
        setTodo(
            newState
        )
    }

    let data = todo.map((item, index) =>
        <tr key={index}>
            <td>{item.name}</td>
            <td>{item.todo}</td>
            <td><button class="button button1" name={index} onClick={deleteTodo}>Delete</button></td>
        </tr>
    )

    return <> { data}

        <form>
            <label>
                Name:
    <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
        </form>

    </>

}
